// 1.第一步引入vue文件  ==》因为是构造函数  名字需要大写
import Vue from 'vue'
// 4.引入需要加载的组件
import App from './App.vue'
import "bootstrap/dist/css/bootstrap.css" // 引入第三方包里的某个css文件
// axios的全局配置
import axios from "axios";
// - 基础地址
axios.defaults.baseURL = "https://www.escook.cn"
// - 设定时间请求时限
axios.defaults.timeout = 3000
// 2.引入完毕之后  创建vue实例化对象
const vw = new Vue({
  // render:需要渲染的组件
  render: (h) => h(App)
})

// 3.给vue实例化对象挂载一个容器  需在html上准备好  （获取容器的id名或者类名）
vw.$mount('#app')
